import React, { Component, Fragment } from 'react';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import SearchIcon from '@material-ui/icons/Search';
import InputBase from '@material-ui/core/InputBase';
import TypoGraphy from '@material-ui/core/Typography';
import Avatar from '@material-ui/core/Avatar';
import SmsRoundedIcon from '@material-ui/icons/SmsRounded';
import NotificationsIcon from '@material-ui/icons/Notifications';
import logo from '../image/arkademy-logo.png';
import CardList from './CardList';

import '../styles/Navbar.css';


class Navbar extends Component {
    render() {
      return (
        <Fragment>
          <AppBar position="fixed" color="second">
            <Toolbar>
              <div className="nav-group">
                <img src={logo} className="logo" alt="logo" />
                <div className="search">
                  <SearchIcon />
                  <InputBase
                    placeholder="Searchâ€¦"
                    inputProps={{ 'aria-label': 'search' }}
                  />
                </div>
                <div className="home">
                  <TypoGraphy variant="title" gutterbottom="true">
                    <h4>Home</h4>
                  </TypoGraphy>
                  <TypoGraphy className="user-detail" variant="title" gutterbottom="true">
                      <Avatar>U</Avatar>
                      <h4>User</h4>
                  </TypoGraphy>
                  <TypoGraphy className="typo-wrap" variant="title" gutterbottom="true">
                      <hr width="1" size="40" />
                      <SmsRoundedIcon className="chat"/>
                      <NotificationsIcon className="notif"/>
                  </TypoGraphy>
                </div>
              </div>
            </Toolbar>
          </AppBar>
          <CardList />
        </Fragment>
      )
    }
  }

export default Navbar
